import React from 'react'
import styled from 'styled-components'

const SubContainer = styled.div`
    display: flex;
    gap: 3em;
`

function Landing3() {
  return (
    <>
        <h2>Explore Celestia</h2>
        <SubContainer>
            <div>Explore the ecosystem</div>
            <div>Use Tia</div>
        </SubContainer>
        <div>Run a light node</div>
    </>
  )
}

export default Landing3;
